  false,\n\t\"url\": null,\n\t\"notes\": \"Bathymetric terrain models of seafloor
  morphology are an important component of marine geological investigations. Advances
  in acquisition and processing technologies of bathymetric data have facilitated
  the creation of high-resolution bathymetric surfaces that approach the resolution
  of similar surfaces available for onshore investigations. These bathymetric terrain
  models provide a detailed representation of the Earth's subaqueous surface and,
  when combined with other geophysical and geological datasets, allow for interpretation
  of modern and ancient geological processes.\",\n\t\"license_title\": null,\n\t\"extras\":
